(50, 'chi', 49, '世界杯特刊', '世界杯特刊', '', '', '<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/b715d6b68ef4f53eb17ef5df93ca5263.JPG" width="350" height="335" alt="" />\r\n</p>\r\n<p>\r\n	<span style="color:#3E3E3E;font-family:宋体;font-size:16px;line-height:32px;orphans:2;white-space:pre-wrap;widows:2;background-color:#FFFFFF;">有多少人在等待凌晨的世界杯开幕式和揭幕战呢？你支持哪一支球队？你喜欢哪一个球星？你是喜欢足球运动还是单纯只为看脸？……不管是真球迷还是伪球迷，能够在这样的赛事中感受到快乐就好。Homix本期特刊，为您呈现2014年世界杯的精彩。</span>\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/7384bc197a25311c5955a1eb36a7e347.JPG" width="350" height="459" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/dbb61a65a0d167d65b72af63db20de99.JPG" width="350" height="413" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/8dcbcaa819a397904600b51b49a8b342.JPG" width="350" height="323" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/b39dd8b2cce195fe3771aa8df14834ad.JPG" width="350" height="426" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/97beed681325563d542e354c46efe75c.JPG" width="350" height="203" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/13883bfc6396d89df766eae19ffe08ad.JPG" width="350" height="353" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/ea0c597e79a6424aacb8564902a99512.JPG" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/b737a6b902519d3a9c06c16a576a6c93.JPG" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/ceb6c5412aac0bea4ae610ecae08cba3.JPG" alt="" />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/af43e757aa943a4d9b915cb642d94359.JPG" width="350" height="243" alt="" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	