(54, 'chi', 50, '当今最火的马克杯你有了吗？', '当今最火的马克杯你有了吗？', '', '', '<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/64faffd6f4a59f5c7c220a3845b4df5b.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;min-height:1.5em;white-space:pre-wrap;line-height:2em;color:#3E3E3E;font-family:宋体;font-size:16px;orphans:2;widows:2;background-color:#FFFFFF;">\r\n	马克杯是当今白领办公桌上必须的东东，如果你是个水桶，那么爱屋建议你的杯具要有以下特质：第一、容量大，不用老是起来去接水。第二、必须要带盖，健康卫生就不用多说了。第三、作为每天伴随8小时以上的密友，长相一定要赏心悦目。\r\n</p>\r\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;min-height:1.5em;white-space:pre-wrap;line-height:2em;color:#3E3E3E;font-family:宋体;font-size:16px;orphans:2;widows:2;background-color:#FFFFFF;">\r\n	爱屋格林最火的马克杯6月特惠促销，<span style="max-width:100%;color:#FF0000;">手机专享价29元一个</span>，赶快上淘宝购了！别心急，一定要耐心把下面的图片看完，否则买到仿品、假货可糗大了~\r\n</p>\r\n<img src="http://img.seevia.cn/media/photos/201406/0/2/original/b0b92d2471d20edda4bb2b36fc738ab8.JPG" alt="" /> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/0d0baa143b18c06f3c1fdba0cdefe64b.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/10df9dcf1c546dbd6ebac2e74c64d0aa.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/6f58d3fe1d40a4ab559e4f003b54a2bb.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/56e788b375cb546d850aa7f08d531980.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/4825f3076467b9921b2fa5e9772cada0.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/4a7d6820e75efd22958eb00f3b377b7c.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/0ba9eb468c902f2333a7d986d1413bd8.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/08058e52f132e7030cb049cba3635164.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/3dba2572dd009c0003d5c2a5406415c0.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/a6b19646728e255165dd88324503f1a3.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', NULL, '', '', '', '2014-06-20 09:12:26', '2014-06-20 09:12:26'),
