(57, 'chi', 52, '婴儿健康零过敏-可瑞康婴儿奶粉', '可瑞康', '', '', '<p>\r\n	Karicare是全球母婴营养专家Nutricia旗下著名婴幼儿奶粉品牌。\r\n</p>\r\n<p>\r\n	Karicare起源于1896年，由Truby King博士开发的，他最早开发这个产品的动力是“帮助辛劳的妈妈，保护可爱的宝宝”。经过百年发展，Karicare现已成为新西兰和澳大利亚市场领导品牌，是新西兰和澳大利亚妈妈们的首选品牌，尤以Karicare金装系列最受消费者青睐。\r\n</p>\r\n<p>\r\n	Karicare金装系列婴幼儿配方奶粉，适合0-3岁宝宝。特含先进的科学营养配方，为宝宝每个成长阶段提供最佳的营养支持。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<strong><span style="font-size:16px;">冲泡方法</span></strong> \r\n</p>\r\n<p>\r\n	1.准备喂哺前，先将双手洗干净，将奶瓶奶嘴置入开水中煮沸消毒，或者用合格的消毒器消毒。\r\n</p>\r\n<p>\r\n	2.将饮用水煮沸放凉。\r\n</p>\r\n<p>\r\n	3.将正确量煮开过的凉水倒入奶瓶，加热到喂哺温度。\r\n</p>\r\n<p>\r\n	4.只能使用随附勺子。轻轻的舀满一勺并用内置校平机压平，避免压实奶粉。\r\n</p>\r\n<p>\r\n	5.一平勺奶粉兑50毫升水。盖好奶瓶盖，摇动奶瓶至奶粉完全溶解。\r\n</p>\r\n<p>\r\n	6.喂哺前，把奶液滴在手腕上试温，冲调好后马上喂哺（不要贮存），喂完后多余的奶液请丢弃。\r\n</p>\r\n<p>\r\n	* 每次只准备一次的喂量，对于所有配方奶，准备好后马上食用是安全的。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', '', 'http://img.seevia.cn/media/photos/201511/0/15/detail/bdf8b7c43abf486af5a511f02f41f960.jpg', '', '2016-01-18 17:14:35', '2016-01-18 17:14:35'),
(61, 'chi', 46, 'EVERGREEN品牌故事', 'EVERGREEN品牌故事', '', '', '<p>\r\n	<span style="white-space:nowrap;"><span style="white-space:nowrap;"><span style="white-space:nowrap;"><span style="white-space:nowrap;"> <img src="http://img.seevia.cn/media/photos/201406/0/2/original/d77ce093c30f449b9fbeaba37b59f500.JPG" alt="" /></span></span></span></span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	1993年，常青诞生于创始人仇非和徐婷夫妇弗吉尼亚的车库中，从一个家庭小作坊成长为引领全球家居、花园、户外、礼品、母婴市场潮流的大型生活方&nbsp;式企业,并赢得了“世界彩旗之王”的美誉。\r\n</p>\r\n<p>\r\n	常青融设计、制造、分销、零售于一体，有目录邮购、电子商务、线下零售店和特殊渠道等多元化的通路组合，服务全球超过几千万的消费者和零售商，足迹遍布北美、欧洲、东南亚和中国等。\r\n</p>\r\n<p>\r\n	对于顾客来说，常青的价值就是依托全球整合的供应链，为他们提供温馨、贴心、放心的一站式采购咨询服务。公司从成立的第一天起就是盈利的，每年保持30%以上的增长。\r\n</p>\r\n<p>\r\n	常青在美国里士满总部、Madison、加拿大、宁波北仑、景德镇、上海等地设有公司或办事处，拥有上百万平方米的仓储、物流和生产设施，全球雇员达2000多人。凭借在供应链的长期积累和对顾客需求的细致体察，常青连续多年被美国权威杂志《礼品\r\n</p>\r\n<p>\r\n	前沿》评为家居品类市场占有率冠军，广受零售商和消费者喜爱；我们2010年所收购的Plow&nbsp;&amp;&nbsp;Hearth集团是Madison当地最大的雇主，被弗吉尼亚州长誉为当地商业的典范；\r\n</p>\r\n<p>\r\n	2011年，常青中国被《浙商》杂志评为“最具投资潜力企业”之一。\r\n</p>\r\n<p>\r\n	而两位创始人仇非和徐婷曾分别荣膺“安永弗吉尼亚州年度敬业企业家”和“弗吉尼亚州年度女性企业家”的称号，并倾力为当地学校、社会组织和公益事业贡献自己的力量，在全球商界和学界有着很好的口碑。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	从业务结构来看&nbsp;中美之间水乳交融，既是彼此的供应商和市场，又分享着高度整合的信息、知识、技术、操作平台和人才，凭借中美两方互补的资源和团队，发挥着最大的协同效应。这也决定了我们较之本土企业具有更高的站位和眼光，后续发展具\r\n</p>\r\n<p>\r\n	有强大的爆发力和长远性。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style="white-space:nowrap;"><img src="http://img.seevia.cn/media/photos/201406/0/2/original/1831e4727759db5ea2cf1426097573e8.JPG" alt="" height="644" width="669" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style="white-space:nowrap;"><span style="white-space:nowrap;"><br />\r\n</span></span> \r\n</p>\r\n<p>\r\n	<span style="color:#99BB00;font-size:16px;"><span style="color:#99BB00;font-size:16px;"><strong>四大竞争优势:</strong></span></span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<ul>\r\n	<li>\r\n		<span style="font-size:12px;line-height:1.5;"></span><span style="font-size:12px;line-height:1.5;">自有十大品牌，四大领域全方位覆盖中产阶级家庭生活方式（家居、园艺、户外、母婴）</span> \r\n	</li>\r\n	<li>\r\n		<span style="font-size:12px;line-height:1.5;">渠道为王，分销零售、线上线下、北美全球齐头并进。</span> \r\n	</li>\r\n	<li>\r\n		<span style="font-size:12px;line-height:1.5;"></span><span style="font-size:12px;line-height:1.5;">全球整合的供应链体系，依托中美各自优势，在产供销价值链上取得最大效益。</span> \r\n	</li>\r\n	<li>\r\n		<span style="font-size:12px;line-height:1.5;">通过不同阶段的战略性收购，来延伸产品线和销售渠道，加速成长和国际化步伐.</span> \r\n	</li>\r\n</ul>\r\n<span style="white-space:nowrap;"> \r\n<div style="white-space:nowrap;">\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/4fe465f4d6792b48ff829300c606598f.JPG" alt="" height="179" width="669" /><br />\r\n</div>\r\n</span> \r\n<p>\r\n	<br />\r\n</p>\r\n<span style="white-space:nowrap;"></span> \r\n<p>\r\n	经过近20年的辛勤耕耘，常青营销网络遍及世界，客户包括全美14,000多家独立零售商、200多家连锁店客户、其他国际分销渠道以及线上线下的终端消费者，近年来又积极拓展国内市场，以电子商务传承这份美的事业。常青人始终秉承“一流的产品，一流的做事方法，一流的顾客，一流的团队”的宗旨，在美国权威杂志《礼品前沿》的年度评选中，旗帜、花园和厨房产品连年位居市场占有率第一，家饰和季节性产品也始终名列前茅，并通过兼并收购的手段迅速做大，成为一个多渠道零售商。\r\n</p>\r\n<br />\r\n<span style="white-space:nowrap;"><img src="http://img.seevia.cn/media/photos/201406/0/2/original/203c47297c807ee22309a01b215a1c57.JPG" alt="" height="505" width="669" /><br />\r\n</span> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style="font-size:16px;color:#99BB00;"><strong>战略收购</strong></span> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/42a65a76a9661f4ea39dfaf062c91dcd.JPG" alt="" height="215" width="669" /> \r\n</p>\r\n<p>\r\n	<span style="white-space:nowrap;color:#99BB00;font-size:16px;"><strong><br />\r\n</strong></span> \r\n</p>\r\n<p>\r\n	<span style="white-space:nowrap;color:#99BB00;font-size:16px;"><strong>三层同心圆采购体系</strong></span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	常青这一套稳定有序的供应链管理，谓之“三层同心圆”体系——其中最核心的是四家自有的工厂，主打旗帜、陶瓷、树脂和餐巾长纸产品。\r\n</p>\r\n<p>\r\n	第二层来自我们20多家协作厂，在生产的灵活性和交期上得到保证，最外层是那些拥有较好信誉和知识产权保护的300多家供应商，让常青灵活采购。\r\n</p>\r\n<p>\r\n	常青自有的工厂管理，采用先进的厂房设计和流程控制，雇佣专业人员进行操作。厂内设有检测实验室，来确保在接受专业检测之前就严格符合标准。\r\n</p>\r\n<p>\r\n	在多项制造工艺和技术上，常青都享有发明专利保护，增加了竞争壁垒，同时在安全和质量方面，得到多项第三方机构的认可，如ISO9000，输美陶瓷认证和FDA食品安全认证等。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<span style="white-space:nowrap;"><img src="http://img.seevia.cn/media/photos/201406/0/2/original/5a1dac41138b2dfc9ff970fd687ef305.JPG" alt="" /><br />\r\n</span><br />\r\n<span style="white-space:nowrap;color:#99BB00;font-size:16px;"><strong>品牌秀</strong></span><br />\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/ceb8d55e7ea6c7d8f36b224af346fb4b.JPG" alt="" height="562" width="669" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/ccd0a13404ba060a56775bfbc25d2ea7.JPG" alt="" height="562" width="669" /> \r\n</p>', '', '', 'http://img.seevia.cn/media/photos/201406/0/2/small/507bd4c9a3ee6cd208771b5c4a445ee6.JPG', '', '2016-01-19 09:23:44', '2016-01-19 09:23:44'),
(60, 'chi', 47, 'Homix时尚家居IN', 'Homix时尚家居IN', '', '', '<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/7d9a2d5342a6c27d0fb5f38299db1925.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	Homix时尚家居致力于设计和推广英伦及欧美风格的优质家居，在注重细节及人性化设计的同时，尊重人们对生活品质的追求，铸就极具文化韵味和经典魅力的时尚家居。现Homix官方旗舰店已在京东商城开业，可登陆http://homix.jd.com/关注。\r\n</p>\r\n<img src="http://img.seevia.cn/media/photos/201406/0/2/original/39d0438031554dc2cf3b857b6b0d611a.JPG" alt="" /> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/b4abcffc5ccecd90b3ac7c187aa6feb4.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/62c6ecb53f496a11e1c16b11e01e0e21.JPG" alt="" /> \r\n</p>\r\n<p>\r\n	<img src="http://img.seevia.cn/media/photos/201406/0/2/original/5b79d0ce6afc33f684c78ca8fd78d636.JPG" alt="" /> \r\n</p>', '', '', 'http://img.seevia.cn/media/photos/201406/0/2/small/5bc5c4c8337e638f41e07825e7ad4b66.JPG', '', '2016-01-19 09:23:25', '2016-01-19 09:23:25');
