(1, 'chi', 1, '品牌故事', 'seevia成长记', '', '', '<p>\r\n	Karicare是全球母婴营养专家Nutricia旗下著名婴幼儿奶粉品牌。\r\n</p>\r\n<p>\r\n	Karicare起源于1896年，由Truby King博士开发的，他最早开发这个产品的动力是“帮助辛劳的妈妈，保护可爱的宝宝”。经过百年发展，Karicare现已成为新西兰和澳大利亚市场领导品牌，是新西兰和澳大利亚妈妈们的首选品牌，尤以Karicare金装系列最受消费者青睐。\r\n</p>\r\n<p>\r\n	Karicare金装系列婴幼儿配方奶粉，适合0-3岁宝宝。特含先进的科学营养配方，为宝宝每个成长阶段提供最佳的营养支持。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<strong><span style="font-size:16px;">冲泡方法</span></strong> \r\n</p>\r\n<p>\r\n	1.准备喂哺前，先将双手洗干净，将奶瓶奶嘴置入开水中煮沸消毒，或者用合格的消毒器消毒。\r\n</p>\r\n<p>\r\n	2.将饮用水煮沸放凉。\r\n</p>\r\n<p>\r\n	3.将正确量煮开过的凉水倒入奶瓶，加热到喂哺温度。\r\n</p>\r\n<p>\r\n	4.只能使用随附勺子。轻轻的舀满一勺并用内置校平机压平，避免压实奶粉。\r\n</p>\r\n<p>\r\n	5.一平勺奶粉兑50毫升水。盖好奶瓶盖，摇动奶瓶至奶粉完全溶解。\r\n</p>\r\n<p>\r\n	6.喂哺前，把奶液滴在手腕上试温，冲调好后马上喂哺（不要贮存），喂完后多余的奶液请丢弃。\r\n</p>\r\n<p>\r\n	* 每次只准备一次的喂量，对于所有配方奶，准备好后马上食用是安全的。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', '', '2016-01-21 15:26:09', '2016-01-21 15:26:09');
