(13, 'chi', 13, '澳洲原装进口保健品、绵羊油手膜、UGG等', 'http://img.seevia.cn/media/photos/201512/0/21/original/91560a50bf5a03ea5eb94467c7f313dd.png', '', '<h2 style="margin:0.83em 0px;padding:0px;color:#000000;text-transform:none;line-height:normal;text-indent:0px;letter-spacing:normal;font-family:Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;font-style:normal;font-variant:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"="">【净重】100g</span></span> \r\n	</h2>\r\n<h2 style="margin:0.83em 0px;padding:0px;color:#000000;text-transform:none;line-height:normal;text-indent:0px;letter-spacing:normal;font-family:Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;font-style:normal;font-variant:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""><span style="margin:0px;padding:0px;line-height:28px;vertical-align:baseline;list-style-type:none;list-style-image:none;"></span>【产地】澳大利亚. Made in Australia</span></span> \r\n</h2>\r\n<h2 style="margin:0.83em 0px;padding:0px;color:#000000;text-transform:none;line-height:normal;text-indent:0px;letter-spacing:normal;font-family:Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;font-style:normal;font-variant:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""><span style="margin:0px;padding:0px;line-height:28px;vertical-align:baseline;list-style-type:none;list-style-image:none;"></span>【包装】有纸盒，无密封，无单独说明书</span></span> \r\n	</h2>\r\n<h2 style="margin:0.83em 0px;padding:0px;color:#000000;text-transform:none;line-height:normal;text-indent:0px;letter-spacing:normal;font-family:Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;font-style:normal;font-variant:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""><span style="margin:0px;padding:0px;line-height:28px;vertical-align:baseline;list-style-type:none;list-style-image:none;"></span>【主要成分】羊毛脂、维他命E</span></span> \r\n</h2>\r\n<p style="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:1.12em="" 0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""><strong><span style="background-color:#00FF00;"><span style="background-color:#FFFFFF;"><span style="color:#404040;text-indent:2em;"><span style="font-size:12pt;">澳洲药房唯一销售的绵羊油就是Healthy Care绵羊油，</span></span><strong style="text-indent:2em;">所以宝宝也都可以安</strong><strong style="text-indent:2em;">全放心</strong><strong style="text-indent:2em;">的使用</strong></span></span></strong></span></span> \r\n	</p>\r\n<p style="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:1.12em="" 0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""><span style="background-color:#00FF00;"><span style="background-color:#FFFFFF;"><span style="color:#3D85C6;">现在的绵羊油都只有生产批号，没有生产日期和保质期了。但是可以保存多久呢？我问过了药房的人，回答是这样的，只要在开盖12个月内用完就OK，在下面第二张照片里，左边的包装盒上画着一个打开的盖子，瓶身上写的12M（12 months），就是这个意思。</span></span></span></span></span> \r\n</p>\r\n<p style="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:1.12em="" 0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""><strong><span style="background-color:#00FF00;"><span style="background-color:#FFFFFF;"><span style="margin:0px;padding:0px;line-height:28px;vertical-align:baseline;list-style-type:none;list-style-image:none;"></span>【产品介绍】</span></span></strong></span></span> \r\n	</p>\r\n<p style="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:1.12em="" 0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""><strong><span style="background-color:#00FF00;"><span style="background-color:#FFFFFF;"></span></span></strong></span><span style="font-family:" microsoft="" yahei";"="">此款绵羊油富含澳大利亚天然羊毛脂和VE，带给您一种保湿不油腻的乳霜。适用于所有肤质。保湿，营养和保护您的肌肤。长期使用能使肌肤保持滋润保湿柔软。</span><span style="font-family:" microsoft="" yahei";"="">不含石油提取物和防腐剂。</span><span style="font-family:" microsoft="" yahei";"="">绵羊油最大的特点就是“滋润但绝不油腻，吸收好，软滑细腻”，因为绵羊油结构跟人体表面油脂相似，是所有动物油脂中最适宜人体使用的，这也使它具有相当好 的吸收性。绵羊油的提取也严格的遵循在不伤害动物的前提下进行的，真正好品质好品牌的绵羊油，都是以最高规格品质的绵羊脂做原料，精纯到每百万中仅抽得出 低于三的不纯物，纯度接近百分百。</span></span> \r\n</p>\r\n<p style="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:1.12em="" 0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""></span></span> \r\n	</p>\r\n<p style="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:1.12em="" 0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"="">\r\n	<strong style="line-height:1.5;font-family:" microsoft="" yahei";font-size:18px;"="">【特点】</strong> \r\n</p>\r\n<p style="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:1.12em="" 0px;padding:0px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""> <span style="font-size:18px;"><span style="font-family:" microsoft="" yahei";"=""></span><span style="font-family:" microsoft="" yahei";"="">极易吸收，产品保湿效果好，非常清爽，不油腻，即使是长痘的肌肤也可以使用。很多人刚接触绵羊油产品时，第一个念头就是：会不会很油腻？滋润是滋润 了，脸上冒脂肪粒怎么办？仔细了解加亲自试用后才知道，绵羊油最大的特点就是：“滋润但不油腻，吸收好，软滑细腻”，因为绵羊油结构跟人体表面油脂相 似，是所有动物油脂中最适宜人体使用的，这也使它具有相当好的吸收性。</span></span> \r\n	</p>\r\n<p style="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"=""><img src="http://img.seevia.cn/media/photos/201602/0/1/original/9e65ed4e53606994f1e5400d322c7cec.jpg" style="max-width:730px;max-height:389px;" alt="" /> \r\n</p>\r\n<p style<h2="" style="margin:0.83em 0px;padding:0px;color:#000000;text-transform:none;line-height:normal;text-indent:0px;letter-spacing:normal;font-family:Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;font-style:normal;font-variant:normal;word-spacing:0px;white-space:normal;background-color:#ffffff;-webkit-text-stroke-width:0px;"=""><img src="http://img.seevia.cn/media/photos/201602/0/1/original/16379d6557810ac96dfd6b616f790836.jpg" alt="" style="font-size:16px;max-width:730px;max-height:389px;" /> \r\n	</p>\r\n="font:16px/normal Helvetica, " stheiti="" stxihei",="" "microsoft="" jhenghei",="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"=""&gt;<img src="http://img.seevia.cn/media/photos/201602/0/1/original/16379d6557810ac96dfd6b616f790836.jpg" style="max-width:730px;max-height:389px;" alt="" /> \r\n	<p>\r\n		<br />\r\n	</p>\r\n<p class="attr-list-hd tm-clear" style="font: 16px/normal Helvetica, ; font-size-adjust: none; font-stretch: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"=""> <em>产品参数：</em> \r\n</p>\r\n<p class="attr-list-hd tm-clear" style="font: 16px/normal Helvetica, ; font-size-adjust: none; font-stretch: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"="">\r\n	厂名：swisse wellness pty ltd\r\n	</p>\r\n<p class="attr-list-hd tm-clear" style="font: 16px/normal Helvetica, ; font-size-adjust: none; font-stretch: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"="">\r\n	厂址：澳洲&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;食品添加剂：无\r\n</p>\r\n<p style="font: 16px/normal He