&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;系列:&nbsp;蔓越莓胶囊\r\n	</p>\r\n<p style="font: 16px/normal Helvetica, ; font-size-adjust: none; font-stretch: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"="">\r\n	产品剂型:&nbsp;胶囊&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;产地:&nbsp;澳大利亚\r\n</p>\r\n<p style="font: 16px/normal Helvetica, ; font-size-adjust: none; font-stretch: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"="">\r\n	规格（粒/袋/ml/g）:&nbsp;25000mg*30粒\r\n	</p>\r\n<p style="font: 16px/normal Helvetica, ; font-size-adjust: none; font-stretch: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"="">\r\n	包装方式:&nbsp;包装\r\n</p>\r\n<p style="font: 16px/normal Helvetica, ; font-size-adjust: none; font-stretch: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"=""><img src="http://img.seevia.cn/media/photos/201602/0/1/original/d88e40d2e60c47d14905128492a70c12.jpg" alt="" style="max-width:730px;max-height:370px;" /><img src="http://img.seevia.cn/media/photos/201602/0/1/original/524da0acd811c4fb007c0c273d59036f.jpg" style="max-width:730px;max-height:370px;" alt="" /> \r\n	</p>\r\n<span yahei";color:#ff00ff;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;float:none;display:inline="" !important;white-space:normal;-webkit-text-stroke-width:0px;"="" microsoft=""><p style="white-space: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;text-align:center;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"=""><span style="color:#9900FF;line-height:27px;"><span style="line-height:1.5;">UGG Gorgeous Australia 100%美利奴羊毛薄款</span></span><span style="color:#9900FF;line-height:27px;"><span style="line-height:1.5;">围巾/丝巾/披肩</span></span> \r\n</p>\r\n<p style="white-space: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;text-align:center;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"=""><span style="color:#9900FF;line-height:27px;"><span style="line-height:1.5;"></span></span><span style="color: rgb(153, 0, 255); line-height: 27px;" microsoft="" yahei";font-size:18px;"=""><span style="line-height:1.5;">新款</span></span><span style="color: rgb(153, 0, 255); line-height: 27px;" microsoft="" yahei";font-size:18px;"="">火爆预定中！！</span> \r\n	</p>\r\n<p style="white-space: normal;" stheiti="" stxihei",="" jhenghei",="" "microsoft="" yahei",="" tohoma,="" arial;margin:5px="" 0px="" 1em;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;white-space:normal;-webkit-text-stroke-width:0px;"=""><span style="color:#FF00FF;"><span style="line-height: 27px;" microsoft="" yahei";font-size:18px;"=""></span><span style="font-size:18px;"><span microsoft="" yahei";"="">澳洲时尚一直是简单随性，用料精湛，强调配饰的风格。此款围巾春天秋天冬天都可佩戴，穿越三季的美丽！送爱人，送朋友，送妈妈，送自己，尽显随性奢华简约时尚的风格。</span></span></span> \r\n</p>\r\n</span>', '', '', '', '2016-02-05 15:28:29', '2016-02-05 15:28:29');
