(2574, 'chi', 2572, '美国evergreen时尚创意家居 油瓶/调味瓶套装3GP370', '', '<table width="710" border="0">\r\n    <tbody>\r\n        <tr>\r\n            <td colspan="2">\r\n            <div align="center"><img height="250" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//128/4/original/ppxy.gif" /></div>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><img height="50" alt="" width="710" border="0" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//128/4/original/fgl-1.gif" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><span style="font-size: 14px; color: rgb(62,57,27); font-family: 细黑">\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">商品规格：32*12*7.5</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">商品重量：1.1千克</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">商品容量：250ml（单只油瓶） </span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">商品材质：玻璃+不锈钢</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">专柜价：82元</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">爱屋价：68元</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">此商品包括：2个油瓶+1个铁架子</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">商品功能及特色介绍：</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">1）这不仅是一个再普通不过的油瓶，更是一件艺术品。</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">2）功能多样，既可放酱料，也可放其他液体类物品，如洗洁精、液体肥皂等</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">3）瓶塞使用多层橡胶圈设计，密封性好。</span></p>\r\n            <p><span style="font-size: 14px; color: #3e391b; font-family: 细黑">4）油嘴，采用导管引流设计，使用干净方便，不用担心液体回流弄脏瓶身。</span></p>\r\n            </span></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><img height="50" alt="" width="710" border="0" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//128/4/original/fgl-2.gif" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><img height="473" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//98/1/original/3GP1288-f.JPG" /><br />\r\n            &nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td height="50"><span style="font-size: 16px; color: #3e391b">生活中不能缺少的是一双发现美的眼睛。一个再普通不过的油瓶，因为有了别致的装饰图案而变为一件艺术品，在日常使用中讲述着主人的心情故事。 </span></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><img height="473" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//98/1/original/3GP1288-g.JPG" /><br />\r\n            &nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td height="50"><span style="font-size: 16px; color: #3e391b">合金支架，美观大方，节省空间，碰撞中也不会倒。 </span></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><img height="473" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//98/1/original/3GP1288-h.JPG" /><br />\r\n            &nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td height="50"><span style="font-size: 16px; color: #3e391b">瓶嘴采用导管引流设计，方便倒油和控制油量，防止液体回流。</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><img height="50" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//128/4/original/fgl-3.gif" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><img height="473" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//98/1/original/3GP1288-i.JPG" /><br />\r\n            &nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td height="50"><span style="font-size: 16px; color: #3e391b">在空中翱翔的林地鸟，代表了对自由的向往，崇尚了回归自然的悠然心情。</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan="2"><img height="473" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201011//98/1/original/3GP1288-j.JPG" /><br />\r\n            &nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td height="50"><span style="font-size: 16px; color: #3e391b">瓶嘴采用多层橡胶圈设计，密封性好。</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td align="center"><img height="50" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201012//128/4/original/fgl-8.gif" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td align="center"><img height="473" alt="" width="710" src="http://www.myevergreenonline.com.cnhttp://img.seevia.cn/media/photos/201012//98/4/original/3gp-1.JPG" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td height="100"><span style="font-size: 16px; color: #3e391b">调味瓶礼盒套装包装图片，内有2个调味瓶以及铁架，送礼体面过人。</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>', '', '', '', 0.00, 0.00, '油碟 油瓶 油 碟 瓶  青花 陶瓷 欧美 创意 彩绘', '搞品质玻璃，表面图案采用特殊烤花、分色技术，画面质感更加精致细腻；油瓶为导管引流设计，有效控制油量及防止侧漏，瓶嘴采用多层橡胶圈设计，密封性能好，下层杆保持瓶内气压平衡，', '', '', '2011-01-04 14:23:42', '2011-04-14 10:29:57'),
