(5804, 'chi', 5755, '澳洲直邮KARICARE/可瑞康Aptamil金装加强3段1~3岁整箱包邮', NULL, '<p>\r\n	<span style="font-family:''tahoma, arial, Hiragino Sans GB, 宋体, sans-serif'';"><span style="line-height:23.99147605895996px;white-space:nowrap;"><span style="font-family:tahoma, arial, ''Hiragino Sans GB'', 宋体, sans-serif;font-size:12px;line-height:18px;white-space:normal;background-color:#F6F6F6;"></span></span></span> \r\n</p>\r\n<p>\r\n	<span style="font-family:''tahoma, arial, Hiragino Sans GB, 宋体, sans-serif'';"><span style="line-height:23.99147605895996px;white-space:nowrap;">\r\n	<p style="margin-top:1.12em;margin-bottom:1.12em;padding:0px;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:21px;white-space:normal;background-color:#FFFFFF;">\r\n		<span style="font-size:18px;"><strong><span style="font-family:''arial black'';color:#4C33E5;">【澳洲直邮】KARICARE/可瑞康Aptamil金装加强2段6~12个月整箱包邮</span></strong></span>\r\n	</p>\r\n	<p style="margin-top:1.12em;margin-bottom:1.12em;padding:0px;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:21px;white-space:normal;background-color:#FFFFFF;">\r\n		<strong><span style="color:#EE33EE;font-size:16px;">关于真伪：亲们下单后提供一个暗号（任何你自己明白的数字或字母</span><span style="color:#EE33EE;font-size:16px;">），收到后每罐奶粉开盖后都会写上次暗号（简短些</span><span style="color:#EE33EE;font-size:16px;">），保证直邮过程中不被调包。</span></strong>\r\n	</p>\r\n	<p style="margin-top:1.12em;margin-bottom:1.12em;padding:0px;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:21px;white-space:normal;background-color:#FFFFFF;">\r\n		<strong><span style="color:#EE33EE;font-size:16px;">关于直邮：由于澳洲到中国航空距离遥远，包裹会由几方人员经手，不管谁的野蛮搬运都可能造成亲们收到的包裹外观有点小磨损，当然我们会尽量包裹结实，如果很不理解或者很介意的亲们，请绕道不要买国外直邮的商品了。航空直邮正常情况下为7-12工作日（但是没有谁保证这个时间），但是还有很多不可排除的因素可能会延长包裹到达的速度：航班延误、海关抽检、海关清关慢等等。希望亲们有这个心理准备，特别是奶粉这类宝宝的口粮，一定要提前一点时间订购，以防宝宝断奶。商品邮寄后，掌柜会提供快递单号及快递公司网站，方便亲们自己查询进度。到了国内是转EMS或者其他快递，网站上都有衔接；如果实在不放心的亲们，收到包裹时候可以小心的撕开国内的转运单，下面贴的就是澳洲掌柜填寄的邮单了。</span></strong>\r\n	</p>\r\n	<p style="margin-top:1.12em;margin-bottom:1.12em;padding:0px;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:21px;white-space:normal;background-color:#FFFFFF;">\r\n		<strong><span style="color:#EE33EE;font-size:16px;">关于邮费：所有奶粉包邮税，且都可以混寄，不同阶段不同品牌都可以拼着寄。价格会按照实际来收取。第一次买小店奶粉和换品牌奶粉的亲们，单罐也是可以包邮税直邮的哦~~！除了奶粉外其他产品都可以拼单寄，邮费会按照实际重量修改~！</span></strong>\r\n	</p>\r\n	<p style="margin-top:1.12em;margin-bottom:1.12em;padding:0px;font-family:tahoma, arial, 宋体, sans-serif;font-size:14px;line-height:21px;white-space:normal;background-color:#FFFFFF;">\r\n		<br />\r\n	</p>\r\n</span></span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style="font-family:''tahoma, arial, Hiragino Sans GB, 宋体, sans-serif'';"><span style="line-height:23.99147605895996px;white-space:nowrap;"><span style="font-family:tahoma, arial, ''Hiragino Sans GB'', 宋体, sans-serif;font-size:12px;line-height:18px;white-space:normal;background-color:#F6F6F6;">生产日期: 2012年09月01日 至 2012年09月01日</span><br />\r\n</span></span> \r\n</p>', NULL, '', '', 0.00, 0.00, '', '', '', '', '2014-06-23 17:10:45', '2014-06-23 17:12:15'),
